(ns blackout.sb
  (:require [environ.core :refer [env]]
            [clojure.string :as str]
            [cheshire.core :as json]
            [clojure.core.async :refer [chan go >!] :as async]
            [org.httpkit.client :as http]
            [org.httpkit.server :as server]
            [blackout.riemann :as r])
  (:import [com.auth0.Auth0]))

(def config
  {:base-uri "https://master.sb.vitallabs.co"})

(defn username
  [id]
  (if id
    (format "dummy%d@vitallabs.co" id)
    "dummy@vitallabs.co"))

(defn make-uri
  [route]
  (str (:base-uri config) route))

(defn json-body
  [response]
  (if (= (:status response) 200)
    (update response :body json/parse-string true)
    response))

(defn response-time
  "Example of how to include server-provided response time in riemann output"
  [response]
  (-> response
      (assoc :request-time
             (- (System/currentTimeMillis) (:request-start (:opts response))))
      (update-in [:opts] dissoc :request-start)))

(defn request
  ([path] (request :get path))
  ([method path] (request method path nil))
  ([method path options] (request method path options nil))
  ([method path options body]
   (let [response (chan)
         success-fn (fn [{:keys [status] :as resp}]
                      (let [resp2 (-> (response-time resp)
                                      (json-body)
                                      (r/riemann-trace))]
                        (go (>! response resp2))))
         uri (make-uri path)
         context (:context options)
         http-options (merge
                  {:headers
                   (merge {"Content-Type" "application/json"
                           "Authorization" (str "Bearer " (:token context))}
                          (:headers options))
                   :request-start (System/currentTimeMillis)
                   :insecure? true}
                  (dissoc options :headers :context :raw))]
     (case method
       :get (http/get uri http-options success-fn)
       :post (let [body (if (:raw options)
                          body
                          (json/generate-string body))]
               (http/post uri (assoc http-options :body body) success-fn)))
     response)))


;;
;; Operations
;;

(defn success?
  [response]
; (println (:status response) (:body response))
  (cond
    (map? response) (= (:status response) 200)
    (sequential? response) (= (:status (first response)) 200)
    :default false))

(defn success-chan?
  "Given a request function that returns a
   response channel, return a response channel
   that "
  [ch]
  (async/map success? [ch]))

;; AUTH0

(defonce creds-cache
  (atom {}))

(defn do-authenticate
  "Hit auth0 and return creds"
  [user-id]
  (let [uname (username user-id)]
    (if-let [creds (get @creds-cache uname)]
      creds
      (let [auth0 (new com.auth0.Auth0 "BEWxd48ZgX9KPHm3nvYm44K57n8aMIGK" "vitallabs.auth0.com")
            client (.newAuthenticationAPIClient auth0)
            creds (-> client
                      (.login uname "test")
                      (.setConnection "Username-Password-Authentication")
                      (.execute))]
        (swap! creds-cache assoc uname creds)
        creds))))

(defn authenticate
  "Grab an access token from Auth0.  Use auth0 java library"
  [context]
  (let [creds (do-authenticate (:user-id context))
        token (.getIdToken creds)]
    [true (assoc context :token token)]))

(defn register-with-sb
  [email creds]
  (request :post "/v1/user/" {} {"access_token" (.getAccessToken creds)
                                 "id_token" (.getIdToken creds)
                                 "token_type" "bearer"}))

(defn register-user
  [email]
  (let [auth0 (new com.auth0.Auth0 "BEWxd48ZgX9KPHm3nvYm44K57n8aMIGK" "vitallabs.auth0.com")
        client (.newAuthenticationAPIClient auth0)
        creds (-> client
                  (.signUp email "test")
                  (.setConnection "Username-Password-Authentication")
                  (.execute))]
    (swap! creds-cache assoc email creds)
    (register-with-sb email creds)
    true))

(defn register-users
  [start end]
  (doseq [id (range start end)]
    (register-user (username id))
    (println (username id))
    (Thread/sleep 5000)))

;; PING

(defn ping
  [context]
  (success-chan? (request :get "/v1/user/" {:context context})))

(def ping-simulation
  {:name "Ping simulation"
   :scenarios [{:name "Ping scenario"
                :steps [{:name "Authenticate"
                         :request #'authenticate}
                        {:name "Ping Status Endpoint"
;                        :sleep-before (constantly 1000)
                         :request #'ping}]}]})

;; WRITE

(declare payload)

(defn write-payload
  [context]
  (go
    (let [response (async/<! (request :post "/v1/reading/" {:context context  :raw true} payload))
          success (success? response)]
      (if success
        [true (assoc context :reading-id (get-in response [:body :id]))]
        [false (assoc context :response response)]))))

(def payload-simulation
  {:name "Writer payload simulation"
   :scenarios [{:name "Write Payload Scenario"
                :steps [{:name "Authenticate"
                         :request #'authenticate}
                        {:name "Write Payload"
                         :request #'write-payload}
                        {:name "Ping Status Endpoint"
                         :sleep-before (constantly 1000)
                         :request #'ping}
                        #_{:name "Read-back Payload"
                           :request read-payload}
                        #_{:name "Read-back Result"
                           :sleep-before (constantly 1000)
                           :request read-payload
                           }]}]})


(def simulations
  {:ping ping-simulation
   :payload payload-simulation
   })



